import { StyleSheet } from 'react-native';


export const globalStyle = StyleSheet.create({
    main: {
        flex: 1,
        padding: 20,
        borderRadius: 10
    },
    title: {
        fontSize: 20,
        color: '#333',
        fontFamily: 'rs-bold',
        textAlign: 'center'
    },
    container: {
        width: 100,
    },
    btn: {
        margin: 2,
        borderWidth: 1,
        borderRadius: 25,
    },
})
